import React from 'react'
import { StyleSheet, Text, View,Image, TextInput,TouchableWithoutFeedback,TouchableOpacity } from 'react-native'

const Loginpage = () => {
    return (
        <View style={styles.container}>
        <View>
<Image
  source={require("../assets/login1.png")}
  style={styles.mainimage}
/>   
</View> 
<View style={styles.inputcontainer}> 
<TextInput
placeholder='Enter Your Email'
onPress={(input)=>{}}
style={styles.inputfield}
/>
<TextInput
placeholder='Enter Password'
onPress={(input)=>{}}

style={styles.inputfield}
/>
    

        </View>
        <View>
        <TouchableWithoutFeedback ><Text style={{color:'blue',paddingTop:20}}>Forgot Password?</Text></TouchableWithoutFeedback>
        </View>
        <View style={styles.buttoncontainer}>
            <TouchableOpacity style={styles.button}><Text style={styles.buttonText}>Sign in</Text></TouchableOpacity>
        </View>
        </View>
    )
}

export default Loginpage

const styles = StyleSheet.create({
    container:{
        flex: 1,
        justifyContent:'center',
        alignItems:'center'
    },
    mainimage:
        { width:240, height: 240,justifyContent:'center',alignSelf:'center',marginTop:-90,marginBottom:50 }
        ,
        inputcontainer:{
            width:'80%'
        },
        inputfield:{
            backgroundColor:'white',
            paddingVertical:10,
            paddingHorizontal:15,
            borderRadius:10,
            marginTop:15,
           
        },
        buttoncontainer:{
            width:'60%',
            justifyContent:'center'
        }
    
})
